import Navbar from "./Navbar";
import Pricing from "./pages/Pricing";
import Home from "./pages/Home";
import About from "./pages/About";

function App() {
  let component;
  switch (window.location.pathname) {
    case "/":
      component = <Home/>;
      break;
      case "/pricing":
        component = <Pricing/>;
        break;
        case "/about":
          component = <About/>;
          break;
  }

  return <Navbar />


}

export default App;
